			script = "# This rule creates the dictionaries for a ROOT based library.\n# As input it needs the header file for the class that needs a dictionary, i.e. myclass.h\n# Each of these header files needs a \"LinkDef\" file: <myclass>_LinkDef.h\n# If you want multiple classes, with separate headers, in one dictionary file,\n# then either created a <combined>.h and <combined>_LinkDef.h where the <combined>.h includes\n# all the needed headers (suggestion would be to call this <target name>Def.h)\n# OR include all other classes in the <target>.h\n#\n# The output will be <myclass>Dict.cpp and <myclass>Dict_rdict.pcm\n# The cpp files must be compiled and included in the library. The rdict.pcm must be copied\n# to the install location of the library.\n#\n# The script depends on ROOTSYS being defined in the project.\n#\n# export\nOUTFILES_LOCATION=${DERIVED_FILE_DIR}\nLINKDEF_FILE=${INPUT_FILE_BASE}_LinkDef.h\necho \"INPUT_FILE_PATH: \" ${INPUT_FILE_PATH} \necho \"Dictionary created in: \" ${OUTFILES_LOCATION}\necho \"INPUT_FILE_BASE = \" ${INPUT_FILE_BASE}\necho \"INSTALL_DIR\" = ${INSTALL_DIR}\n#\necho ${ROOTSYS}/bin/rootcling -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict.cpp -c -p -I${HEADER_SEARCH_PATHS// / -I} ${INPUT_FILE_PATH}  ${INPUT_FILE_DIR}/${LINKDEF_FILE}\n${ROOTSYS}/bin/rootcling -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict.cpp -c -p -I${HEADER_SEARCH_PATHS// / -I} ${INPUT_FILE_PATH}  ${INPUT_FILE_DIR}/${LINKDEF_FILE}\n#\n# For ROOT 6 copy the pcm file to the LIB install path.\n#\ntest -d ${DYLIB_INSTALL_NAME_BASE} || mkdir -p ${DYLIB_INSTALL_NAME_BASE}\ntest -d ${BUILT_PRODUCTS_DIR} || mkdir -p ${BUILT_PRODUCTS_DIR}\n# ls ${DERIVED_FILE_DIR}\n# This puts the pcm files in the ${DSTROOT}/${INSTALL_PATH} directory.\nif test -r ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm; then cp -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm ${DYLIB_INSTALL_NAME_BASE}/${INPUT_FILE_BASE}Dict_rdict.pcm; echo \"Copied: \" ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm ${DYLIB_INSTALL_NAME_BASE}/${INPUT_FILE_BASE}Dict_rdict.pcm ; fi\n# This send the pcm files to to build product dir\nif test -r ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm; then cp -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm ${BUILT_PRODUCTS_DIR}/${INPUT_FILE_BASE}Dict_rdict.pcm; echo \"Copied:\" cp -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm   ${BUILT_PRODUCTS_DIR}/${INPUT_FILE_BASE}Dict_rdict.pcm; fi\n";
		};
